import React from 'react';

let currDate = new Date();
let currTime = new Date().toLocaleTimeString();

function App(){

    return(
        <>
        <h1>Hello All!</h1>
        <p>Current Date : {currDate}</p>
        <p>Current Time : {currTime} </p>
        </>
    );
}
export default App;
